item.description:
Set the visibility of elements with our visibility utilities. These utility classes do not modify the display value at all and do not affect layout – .c-invisible elements still take up space in the page. Content will be hidden both visually and for assistive technology/screen reader users.
Apply .c-visible or .c-invisible as needed.
&lt;div class=&#34;c-visible&#34;&gt;...&lt;/div&gt; &lt;div class=&#34;c-invisible&#34;&gt;...&lt;/div&gt; // Class .c-visible { visibility: visible !important; } .c-invisible { visibility: hidden !important; }
